import "./App.css";
import {
  HashRouter as Router,
  Routes,
  Route,
  Link,
  NotFound,
  Navigate,
  useLocation,
  useNavigate,
  useParams,
} from "react-router-dom";

import Records from "./config.json";
import StudyPage from "./StudyPage";
import arrayShuffle from "array-shuffle";

function withRouter(Component) {
  function ComponentWithRouterProp(props) {
    let location = useLocation();
    let navigate = useNavigate();
    let params = useParams();
    return (
      <Component
        {...props}
        key={parseInt(params.study_part_i)}
        router={{ location, navigate, params }}
      />
    );
  }

  return ComponentWithRouterProp;
}

const SERVER_URL = "http://0.0.0.0:8194/";

function generateUserId() {
  return "_" + Math.random().toString(36).substr(2, 9);
}

function generateRandomOrdering() {
  const order = [0, 1, 2, 3, 4, 5];
  const remaining_condition = arrayShuffle([6, 7, 8, 9, 10, 11, 12, 13, 14]);
  const final_order = order.concat(remaining_condition);
  return final_order;
}

const ordering = generateRandomOrdering();

function App() {
  var config = Records;
  var StudyPageWithRouter = withRouter(StudyPage);
  return (
    <div className="App">
      <Router>
        <div>
          {/*
            A <Routes> looks through all its children <Route>
            elements and renders the first one whose path
            matches the current URL. Use a <Routes> any time
            you have multiple routes, but you want only one
            of them to render at a time
          */}
          <Routes>
            <Route
              exact={true}
              path="/"
              element={<Navigate to={`/${generateUserId()}/study/0`} />}
            />
            {/* <Route path="/:id/instructions" element={<Instructions />} /> */}
            <Route
              exact={true}
              path={`/:id/study/:study_part_i`}
              element={
                <StudyPageWithRouter server_url={SERVER_URL} config={config} />
              }
            />
            {/* <Route
              exact={true}
              path={`/:id/completionCode`}
              element={<CompletionCode />}
            /> */}
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
